import React from 'react';
import css from '../styles/main.scss';
import Router from 'next/router';

const OutlineBtn = ({ path, func, back }) => {
  const handleClick = () => {
    if (path) {
      return () => Router.push(path);
    } else if (func) {
      return func;
    } else if (back) {
      console.log('back!!');
      // return () => Router.back();
    }
  };
  return (
    <div onClick={handleClick} className={css.outlineBtn}>
      {props.name}
    </div>
  );
};

export default OutlineBtn;
